(18, '7-must-have-weldinproposed-infrastructure-bill-holds-opportunity-for-fabricatorsg-accessories', '1207130061.jpeg', '7 Must have WeldinProposed Infrastructure Bill Holds Opportunity for Fabricatorsg Accessories', 'The proposed infrastructure Bill has been discussed and debated in Congress for several months and has recently passed through the Senate. Should the Bill pass through the House of Representatives, it will be signed by the President and go into effect over the next eight years. This plan is a historical public investment in upgrading the nation’s infrastructure and provides many opportunities for fabricators and welders should it pass.', '2021-09-14', '<h2 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; line-height: 1.2em; font-size: 2.25em; font-family: &quot;Titillium Web&quot;, sans-serif;\">What’s in the Bill?</h2><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">This Bill, should it pass through the House and make it to the White House for signature into law, will invest $110 billion into roads, bridges, and major infrastructure projects. The bill will address many issues facing many Americans, as well as provide upgrades to aging facilities and structures. Some of the upgrades include:</p><ul style=\"box-sizing: inherit; max-width: 80%; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\"><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\"><h3 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; font-weight: bold; line-height: 1.2em; font-size: 1.75em;\">Transportation: Highways, Bridges, Ports, Airports, and Railways</h3></li></ul><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">This Bill will modernize thousands of miles of highways, roads, and streets. It will fix ten of the most economically significant bridges that are in need of reconstruction, as well as 10,000 of the worst smaller bridges. The Bill will replace thousands of buses and rail cars, as well as repairing hundreds of stations, airports, and transit and rail systems. Airports and water ports all need to be addressed and the Bill will upgrade inland waterways, coastal ports, and ferries. The plan is to provide affordable, convenient, and car free access to air travel. It will connect communities that have been previously divided.&nbsp;</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\"><span class=\"hs-cta-wrapper\" id=\"hs-cta-wrapper-9a4d8720-87a3-4f59-97e3-eaa1281eb839\" style=\"box-sizing: inherit;\"><span class=\"hs-cta-node hs-cta-9a4d8720-87a3-4f59-97e3-eaa1281eb839\" id=\"hs-cta-9a4d8720-87a3-4f59-97e3-eaa1281eb839\" data-hs-drop=\"true\" style=\"box-sizing: inherit; visibility: visible;\"><a id=\"cta_button_2025954_e53f8bf0-70d2-491c-ae91-7008045779e7\" class=\"cta_button\" href=\"https://blog.swantonweld.com/cs/c/?cta_guid=e53f8bf0-70d2-491c-ae91-7008045779e7&amp;signature=AAH58kHxu31X80U2vZYG-crsU-ohUj0DVQ&amp;pageId=60298579999&amp;placement_guid=9a4d8720-87a3-4f59-97e3-eaa1281eb839&amp;click=a5e6c355-ed3a-4ab4-a043-dcb50456162c&amp;hsutk=8f75564922b5615411b625c020f0ab55&amp;canon=https%3A%2F%2Fblog.swantonweld.com%2Fproposed-infrastructure-bill-holds-opportunity-for-fabricators&amp;portal_id=2025954&amp;redirect_url=APefjpGv2FV-ijmJNrfFP9uS76nq4Qig8QSM_r2cGsETLWqTnVQYlVKG7nwCYW_DkIep6Gk2kCfujvvRoZwClEauTMLPEWg1kWfOtPNBvTCbKsCNP6mUEwCRug-Xtgts33j9Igm1Su-UNuUKDV9QrY72VDr_etQDGN3jEohZPoavzAh7YWTgeYY&amp;__hstc=18271974.8f75564922b5615411b625c020f0ab55.1640113658452.1640113658452.1640113658452.1&amp;__hssc=18271974.1.1640113658453&amp;__hsfp=1665106123&amp;contentType=blog-post\" cta_dest_link=\"http://inbound.swantonweld.com/structural-steel-capability-sheet\" style=\"color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation; vertical-align: middle; box-sizing: content-box !important;\"></a></span></span></p><ul style=\"box-sizing: inherit; max-width: 80%; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\"><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\"><h3 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; font-weight: bold; line-height: 1.2em; font-size: 1.75em;\">Access to Basic Needs: Renewed Water Pipes, Electric Grid, and High-Speed Broadband</h3></li></ul><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">The plan is to bring affordable, reliable, high-speed broadband to every American, including the 35% of rural Americans who lack access to broadband. All lead pips and service lines will be replaced in the drinking water system, and the electric grid will receive an update to better handle the increased needs. The bill would also go to building a nationwide network of plug-in electric vehicle charging stations. These upgrades will not only bring access to all Americans, but will have a positive impact on the environment.</p><h2 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; line-height: 1.2em; font-size: 2.25em; font-family: &quot;Titillium Web&quot;, sans-serif;\">What These Plans Mean for Fabricators and Welding</h2><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Many, if not all, of these projects mean opportunities for the&nbsp;<a href=\"https://blog.swantonweld.com/quality-assurance-and-steel-fabrication\" rel=\"noopener\" style=\"box-sizing: inherit; color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation;\">structural steel&nbsp;</a>industry. Fabricators and welders will be called on to fabricate towers and mounts for solar panels for the renewable energy projects, provide the structural steel fabrication for the electric vehicle charging stations, and fabricate the cellular towers for increasing broadband access. Dams and structures for water control will need custom metal fabrication, and fabrication shops will be the driving force behind all of the structural steel needs for the airports, water ports, and railway upgrades.&nbsp;</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\"><span class=\"hs-cta-wrapper\" id=\"hs-cta-wrapper-4cb5564e-c2a0-4b14-9e5b-0afed2b05677\" style=\"box-sizing: inherit;\"><span class=\"hs-cta-node hs-cta-4cb5564e-c2a0-4b14-9e5b-0afed2b05677\" id=\"hs-cta-4cb5564e-c2a0-4b14-9e5b-0afed2b05677\" data-hs-drop=\"true\" style=\"box-sizing: inherit; visibility: visible;\"><a id=\"cta_button_2025954_6c70c27e-c04e-4ef3-8242-9643aa4ac787\" class=\"cta_button\" href=\"https://blog.swantonweld.com/cs/c/?cta_guid=6c70c27e-c04e-4ef3-8242-9643aa4ac787&amp;signature=AAH58kE0RJqFoOZ5-V6EibJmTiCJt0Qmrw&amp;pageId=60298579999&amp;placement_guid=4cb5564e-c2a0-4b14-9e5b-0afed2b05677&amp;click=472ec98d-69fb-44b3-9e2e-11baf15a0617&amp;hsutk=8f75564922b5615411b625c020f0ab55&amp;canon=https%3A%2F%2Fblog.swantonweld.com%2Fproposed-infrastructure-bill-holds-opportunity-for-fabricators&amp;portal_id=2025954&amp;redirect_url=APefjpHs0Dm1cr9EokatoO2kHgo_Aiqdo9R48WtcqidoyVyGKZdjaw_A9KGhUH-ENEiIdGRumFc6J6q4WdIxrQ3Mr_2OvHYetAZXyZGHh41Bsa3FmIhe8toL0m4XdnSPdiZzb3K3AmJX&amp;__hstc=18271974.8f75564922b5615411b625c020f0ab55.1640113658452.1640113658452.1640113658452.1&amp;__hssc=18271974.1.1640113658453&amp;__hsfp=1665106123&amp;contentType=blog-post\" cta_dest_link=\"http://swantonweld.com/company/careers/\" style=\"color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation; vertical-align: middle; box-sizing: content-box !important;\"><img id=\"hs-cta-img-4cb5564e-c2a0-4b14-9e5b-0afed2b05677\" class=\"hs-cta-img \" mce_noresize=\"1\" alt=\"Learn more about career opportunities at Swanton Welding\" src=\"https://blog.swantonweld.com/hubfs/hub_generated/resized/8f96e349-be11-4068-b739-40776a1984f7.jpeg\" style=\"box-sizing: inherit; max-width: 100%; height: auto; margin: 0px 0px 1.5em; display: block; border-width: 0px;\"></a></span></span></p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">With all the planned upgrades, should this Bill pass through both houses, the opportunities for fabricators and welders are significant. This would be the largest investment in public transit in American history. Welding and fabrication shops can expect the opportunity to work in their own communities as well as the rest of the country. If you’ve ever thought about a career in fabrication, now is a great time to get involved.&nbsp;<a href=\"https://swantonweld.com/get-a-quote/\" rel=\"noopener\" style=\"box-sizing: inherit; color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation;\">Contact Swanton Welding</a>&nbsp;today for more information about this fulfilling and creative career.</p>', 'Equipment', 13, '7 Must have WeldinProposed Infrastructure Bill Holds Opportunity for Fabricatorsg Accessories', 'The proposed infrastructure Bill has been discussed and debated in Congress for several months and has recently passed through the Senate. Should the Bill pass through the House of Representatives, it will be signed by the President and go into effect over the next eight years. This plan is a historical public investment in upgrading the nation’s infrastructure and provides many opportunities for fabricators and welders should it pass.', NULL, '7 Must have WeldinProposed Infrastructure Bill Holds Opportunity for Fabricatorsg Accessories', 'The proposed infrastructure Bill has been discussed and debated in Congress for several months and has recently passed through the Senate. Should the Bill pass through the House of Representatives, it will be signed by the President and go into effect over the next eight years. This plan is a historical public investment in upgrading the nation’s infrastructure and provides many opportunities for fabricators and welders should it pass.', 'https://skylarck.com/public/images/1207130061.jpeg', '2021-12-21 19:09:37', '2021-12-21 19:09:37'),
(19, 'what-drawings-do-i-need-to-get-an-accurate-fabrication-estimate', '2110672648.jpeg', 'What Drawings Do I Need To Get An Accurate Fabrication Estimate?', 'When you are looking for an accurate fabrication estimate, the drawings you provide are more than just a guideline. Think of it like a complex Lego kit, and the detailed drawings you need for your fabricator are like the Lego kit instructions. There might be a big picture of the finished design on the outside of the Lego box-maybe even from different angles showing you what the design will look like when it’s finished. But without detailed instructions you won’t be able to build the kit. You need to know more than what it will look like in the end-in fact you need to know a lot more. You have to know which bricks to use and when, how many of each brick you’ll use in each step, and how the build goes step by step from beginning to end. Fabrication builds are a lot like a complex Lego kit in this regard. To get an accurate estimate for your fabrication project, you need to have your final detailed drawings prepared before contacting your fabrication partner for the next step.', '2021-05-17', '<h2 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; line-height: 1.2em; font-size: 2.25em; font-family: &quot;Titillium Web&quot;, sans-serif;\">What Do You Need to Prepare?</h2><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">The drawings you need for an accurate fabrication estimate should be prepared by an engineer and include all the specifications necessary to build out your project. When you hand your fabrication partner only a picture of the finished product, even as a CAD design, it is nearly impossible for the fabrication shop to recreate that drawing to your specifications. The fabrication team may have an idea of what they’ll need to do, but for your build to be a success they need more. This includes a material list complete with the type and size of material and how many of each part will be needed, and the steps that will go into building each component. When you have an engineer who can provide this detailed blueprint, the fabrication process will move smoothly.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\"><br></p><p></p><h2 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; line-height: 1.2em; font-size: 2.25em; font-family: &quot;Titillium Web&quot;, sans-serif;\">What if You Don’t Know Where to Go For Shop Drawings?</h2><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Having the proper drawings is important, and if you don’t currently have the right engineers to work with, you might not know where to turn for help. Many&nbsp;<a href=\"https://blog.swantonweld.com/fabrication-resources-in-the-midwest\" rel=\"noopener\" style=\"box-sizing: inherit; color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation;\">fabrication shops</a>&nbsp;can steer you in the right direction. Fabrication shops know of quality services that can get your initial sketches from concept to the final detailed drawings needed for an accurate quote and timeline for your fabrication project.&nbsp;</p><h2 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; line-height: 1.2em; font-size: 2.25em; font-family: &quot;Titillium Web&quot;, sans-serif;\">Different Types of Drawings</h2><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">When you are designing your project, there are several different types of drawings. Understanding what goes into each drawing and how that information helps your fabricator is important to determine exactly what your fabricator needs from you prior to the project quote.&nbsp;</p><ul style=\"box-sizing: inherit; max-width: 80%; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\"><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\"><h3 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; font-weight: bold; line-height: 1.2em; font-size: 1.75em;\">3D or CAD Drawings</h3></li></ul><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">These drawings do provide a reference for your fabricator’s engineering staff. The fabricator’s engineering team can use these drawings to gain the information needed to accurately quote the project. However, these drawings will take more lead time to fully understand the material needs and usage. CAD or 3D drawings work well for projects such as ductwork or a clarifier.&nbsp;</p><ul style=\"box-sizing: inherit; max-width: 80%; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\"><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\"><h3 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; font-weight: bold; line-height: 1.2em; font-size: 1.75em;\">Architectural Drawings</h3></li></ul><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Architectural drawings are primarily useful for structural steel fabrication projects. Beams and drill lines can be fabricated using an architectural drawing, even if the steel used will need to be drilled or formed for end use. You will need a fabricator who can work well with your detailer to pull the right steel from your drawings to get your job done correctly.</p><ul style=\"box-sizing: inherit; max-width: 80%; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\"><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\"><h3 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; font-weight: bold; line-height: 1.2em; font-size: 1.75em;\">Assembly Drawings</h3></li></ul><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Assembly drawings are not very useful as fabrication drawings. In many instances, assembly drawings are little more than a sketch. They won’t provide you with the dimensions, measurements, and materials needed. Your fabrication partner will need much more information to take these drawings to the fabrication stage.</p><ul style=\"box-sizing: inherit; max-width: 80%; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\"><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\"><h3 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; font-weight: bold; line-height: 1.2em; font-size: 1.75em;\">Detailed Drawings</h3></li></ul><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Detailed drawings are what your fabricator wants from you. When you submit a detailed drawing, you can get an accurate quote with fewer questions and fewer delays. The engineering team at the fabrication shop can project accurate timelines for material delivery and fabrication, the project managers can ensure that your project is completed and delivered to your satisfaction within the timeline quoted, and your final product will function exactly how it needs to.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\"><span class=\"hs-cta-wrapper\" id=\"hs-cta-wrapper-c101a87d-63f6-4ccc-acde-51e681390ee7\" style=\"box-sizing: inherit;\"><span class=\"hs-cta-node hs-cta-c101a87d-63f6-4ccc-acde-51e681390ee7\" id=\"hs-cta-c101a87d-63f6-4ccc-acde-51e681390ee7\" data-hs-drop=\"true\" style=\"box-sizing: inherit; visibility: visible;\"><a id=\"cta_button_2025954_0cfbce74-9d19-4a85-ab0d-6097eb2490b5\" class=\"cta_button\" href=\"https://blog.swantonweld.com/cs/c/?cta_guid=0cfbce74-9d19-4a85-ab0d-6097eb2490b5&amp;signature=AAH58kHfZJyPqTOaBOLuINlrUR7Lm4Z-RA&amp;pageId=59431242788&amp;placement_guid=c101a87d-63f6-4ccc-acde-51e681390ee7&amp;click=47a8be4c-6d83-4891-b13c-6bbd565917dd&amp;hsutk=76e02075c107aaadfde8c7c5fba353b0&amp;canon=https%3A%2F%2Fblog.swantonweld.com%2Fwhat-drawings-do-i-need-to-get-an-accurate-fabrication-estimate&amp;portal_id=2025954&amp;redirect_url=APefjpF-cOlG3g1vdCnJ3zWlD4ZV6KB6XTlZMpaVqNKHxRNKBqAN7Bta1boODFSrd4FLYwtF4Q5xirHelVNIOR6MXulvGR2e9RkUgxqowVcRkMkcFHeGniugGa0BIKi-qnwR5Ky4uiSD&amp;__hstc=18271974.76e02075c107aaadfde8c7c5fba353b0.1640113659093.1640113659093.1640113659093.1&amp;__hssc=18271974.1.1640113659093&amp;__hsfp=1665106123&amp;contentType=blog-post\" target=\"_blank\" rel=\"noopener\" cta_dest_link=\"https://swantonweld.com/get-a-quote/\" style=\"color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation; vertical-align: middle; box-sizing: content-box !important;\"></a></span></span></p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">When you provide your fabricator with the right drawings for your project, your fabrication can be quoted accurately, your timeline will be clear, the materials will be right, and the project can be completed successfully. Having the right teams working together will get your project from concept to completion, and we can help. If you’ve got a great idea but not sure where to turn for detailed drawings,&nbsp;<a href=\"https://swantonweld.com/get-a-quote/\" rel=\"noopener\" style=\"box-sizing: inherit; color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation;\">contact Swanton Welding</a>. We have the knowledge, experience, and skilled team members to assist you through every step of your next project.&nbsp;</p>', 'Equipment', 13, 'What Drawings Do I Need To Get An Accurate Fabrication Estimate?', 'When you are looking for an accurate fabrication estimate, the drawings you provide are more than just a guideline. Think of it like a complex Lego kit, and the detailed drawings you need for your fabricator are like the Lego kit instructions. There might be a big picture of the finished design on the outside of the Lego box-maybe even from different angles showing you what the design will look like when it’s finished. But without detailed instructions you won’t be able to build the kit. You need to know more than what it will look like in the end-in fact you need to know a lot more. You have to know which bricks to use and when, how many of each brick you’ll use in each step, and how the build goes step by step from beginning to end. Fabrication builds are a lot like a complex Lego kit in this regard. To get an accurate estimate for your fabrication project, you need to have your final detailed drawings prepared before contacting your fabrication partner for the next step.', NULL, 'What Drawings Do I Need To Get An Accurate Fabrication Estimate?', 'When you are looking for an accurate fabrication estimate, the drawings you provide are more than just a guideline. Think of it like a complex Lego kit, and the detailed drawings you need for your fabricator are like the Lego kit instructions. There might be a big picture of the finished design on the outside of the Lego box-maybe even from different angles showing you what the design will look like when it’s finished. But without detailed instructions you won’t be able to build the kit. You need to know more than what it will look like in the end-in fact you need to know a lot more. You have to know which bricks to use and when, how many of each brick you’ll use in each step, and how the build goes step by step from beginning to end. Fabrication builds are a lot like a complex Lego kit in this regard. To get an accurate estimate for your fabrication project, you need to have your final detailed drawings prepared before contacting your fabrication partner for the next step.', 'https://skylarck.com/public/images/2110672648.jpeg', '2021-12-21 19:10:55', '2021-12-21 19:10:55'),
(20, 'recruiting-talented-skilled-workers-college-degree-not-required', '1974791295.jpeg', 'Recruiting Talented Skilled Workers: College Degree Not Required', 'When many people consider a career change, the first obstacle they may see in their way is obtaining the right education. For many jobs, a college degree has wrongly been seen as the only gateway to something rewarding with a living wage. However, many are finding their way into rewarding and stimulating careers through on-the-job training and experience in a skilled trade.', '2021-03-22', '<p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">On the other end of the same equation are employers that are constantly seeking talented workers. They face the same challenge many times. In order to move their business forward, they need skilled employees who stay.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Many companies facing that challenge have begun rethinking hiring requirements that involve a four-year college degree. By turning more towards on-the-job training for skilled labor, they have been able to grow their workforce - and their business - exponentially. All the while, they are training their employees how they would prefer to train them and reaping the benefits. Savvy business owners know it’s a lot easier to teach someone a process if they don’t have bad habits to break first.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\"><span class=\"hs-cta-wrapper\" id=\"hs-cta-wrapper-328363ba-04ba-4818-b890-c2f8ab565fa7\" style=\"box-sizing: inherit;\"><span class=\"hs-cta-node hs-cta-328363ba-04ba-4818-b890-c2f8ab565fa7\" id=\"hs-cta-328363ba-04ba-4818-b890-c2f8ab565fa7\" data-hs-drop=\"true\" style=\"box-sizing: inherit; visibility: visible;\"><a id=\"cta_button_2025954_b839bdc6-3c68-4108-8ffa-eeb22ff10a7e\" class=\"cta_button\" href=\"https://blog.swantonweld.com/cs/c/?cta_guid=b839bdc6-3c68-4108-8ffa-eeb22ff10a7e&amp;signature=AAH58kE53MNQ80nFDvtk2BxzN_wJkwpEOA&amp;pageId=56873488418&amp;placement_guid=328363ba-04ba-4818-b890-c2f8ab565fa7&amp;click=8a82d056-5fe5-4e6e-ba33-476c0f9a6b7e&amp;hsutk=8f7242fb9d18db31b9f36e0742d8e4f2&amp;canon=https%3A%2F%2Fblog.swantonweld.com%2Frecruiting-talented-skilled-workers-college-degree-not-required&amp;portal_id=2025954&amp;redirect_url=APefjpHlWAYvGR8S-3qtaFNnADWOb4TEq1kW4SXFw5ghxS9GVPk9FwAHzfSKGF1ydfK-JyvGEdM-saOfwg3n0unECUdKaaHvDrquytGKPjra86JFQnM5hXgcZ8_zJtjdKVHtPRI2SEr5KZicPte3RLYKtnLbgPLmso_JKJizR9EiBFCoRkt1Uk8&amp;__hstc=18271974.8f7242fb9d18db31b9f36e0742d8e4f2.1640113661349.1640113661349.1640113661349.1&amp;__hssc=18271974.1.1640113661349&amp;__hsfp=1665106123&amp;contentType=blog-post\" target=\"_blank\" rel=\"noopener\" cta_dest_link=\"http://blog.swantonweld.com/hubfs/PDFs/Infographics/Swanton_Infographic.pdf\" style=\"color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation; vertical-align: middle; box-sizing: content-box !important;\"></a></span></span></p><h2 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; line-height: 1.2em; font-size: 2.25em; font-family: &quot;Titillium Web&quot;, sans-serif;\">Industry Growth</h2><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">One of the trends driving on-the-job training and deviating away from four-year degree requirements has been growth in certain industries. At Swanton Welding, we see how the welding and fabrication sector is trending. It\'s clear that companies who are holding out for college graduates may find themselves left behind in an industry that is projected to grow 22 percent over the next decade.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">While some see that growth and project that much of it will be absorbed by robotics and automated lines, we know there will always be a human element involved in the day-to-day operations of metal fabricating. No matter what technology is able to simplify, there is just no way to account for the creative talents of a well-trained skilled worker.</p><h2 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; line-height: 1.2em; font-size: 2.25em; font-family: &quot;Titillium Web&quot;, sans-serif;\">Joining the Swanton Welding Team</h2><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Other career paths may set up roadblocks to jumping right in and getting started. At Swanton Welding, our only requirements are that you’re 18 years old, have a high school diploma or GED, and have a passion for the work. Imagine getting paid for the work you do and receiving on-the-job training as part of that career.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">We make the path less restrictive at Swanton because we know that success in skilled trades such as welding and fabricating relies more on experience and learned skills than anything else.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\"><span class=\"hs-cta-wrapper\" id=\"hs-cta-wrapper-10a4ae05-e62d-44fc-a060-21ab740a3012\" style=\"box-sizing: inherit;\"><span class=\"hs-cta-node hs-cta-10a4ae05-e62d-44fc-a060-21ab740a3012\" id=\"hs-cta-10a4ae05-e62d-44fc-a060-21ab740a3012\" data-hs-drop=\"true\" style=\"box-sizing: inherit; visibility: visible;\"><a id=\"cta_button_2025954_ff79e251-3479-4af1-9391-48609893a786\" class=\"cta_button\" href=\"https://blog.swantonweld.com/cs/c/?cta_guid=ff79e251-3479-4af1-9391-48609893a786&amp;signature=AAH58kGaUnNkpL-ayb9bl2jBOsX6HKaajw&amp;pageId=56873488418&amp;placement_guid=10a4ae05-e62d-44fc-a060-21ab740a3012&amp;click=f83f7e0c-e806-4056-bad8-7917380c6526&amp;hsutk=8f7242fb9d18db31b9f36e0742d8e4f2&amp;canon=https%3A%2F%2Fblog.swantonweld.com%2Frecruiting-talented-skilled-workers-college-degree-not-required&amp;portal_id=2025954&amp;redirect_url=APefjpFIqf-PmyhbsiRKf_JdrYo7iyCt0LWkRPv12vl18DMC2686AEa-gjbNJKhcuQzmVGoO_Mvq23y5DdWpe2QmOFAQ4OmmS0P4Ovz6_X4cL22bdsHzBuxr_eJRajHIB1OyW7Eop9mFSS65pr6w8uQHJIEj7ZfG7RG5csG6iDNE4RzgS4_fKKc&amp;__hstc=18271974.8f7242fb9d18db31b9f36e0742d8e4f2.1640113661349.1640113661349.1640113661349.1&amp;__hssc=18271974.1.1640113661349&amp;__hsfp=1665106123&amp;contentType=blog-post\" cta_dest_link=\"http://inbound.swantonweld.com/swanton-welding-capabilities-and-services\" style=\"color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation; vertical-align: middle; box-sizing: content-box !important;\"></a></span></span></p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Other careers that promise on-the-job training and immediate opportunities may also be just fool\'s gold, looking for entry-level workers who never really get the opportunity to move up. That\'s just not the case at Swanton. Our employee morale and retention rates are high simply because we almost exclusively promote from within. At Swanton, we\'ll give you the opportunity to grow with us. Once you\'re on the team, the sky\'s the limit as far as where you want your career to take you.</p><h2 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; line-height: 1.2em; font-size: 2.25em; font-family: &quot;Titillium Web&quot;, sans-serif;\">A Rewarding Career Awaits</h2><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">From the outside, a career in&nbsp;<a href=\"https://blog.swantonweld.com/\" rel=\"noopener\" style=\"box-sizing: inherit; color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation;\">metal welding and fabricating</a>&nbsp;may seem rather monotonous, but nothing could be farther from the truth. The work we do is ever-changing and creative. Though the skills may be the same, custom metal fabricating means you never know where a job may take you. You might find yourself beginning the assembly of a 50,000-lb. mixing tank on Monday, and by Friday you’re working on a 125,000-lb acid furnace. It\'s hands-on work that will put your mental and physical abilities to the ultimate test. And, you\'ll be performing that work for an industry leader that\'s on the cutting edge.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Beyond that, the career paths you can take are endless. From your first day, you can take early steps towards specific jobs within our company, like:</p><ul style=\"box-sizing: inherit; max-width: 80%; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\"><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\">Machinist</li><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\">Welder</li><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\">Assembly</li><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\">Paint</li><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\">Shipping and Receiving</li><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\">Driver</li><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\">CNC operator</li><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\">Fabricator</li><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\">CAD engineer or Designer</li><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\">Estimator</li></ul><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Along the path to your career in metal fabricating and welding, you\'ll be able to earn certifications which not only look good on your resume, but give you real skills you can apply to the projects you work on. There will be chances for you to take on supervisor and management opportunities if that’s something you’re interested in pursuing. All the while, you\'ll be earning a steady paycheck with great job security and benefits. When it comes time for you to take the next step in your career, you\'ll be able to do so, confident in your abilities and talents.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\"><span class=\"hs-cta-wrapper\" id=\"hs-cta-wrapper-4cb5564e-c2a0-4b14-9e5b-0afed2b05677\" style=\"box-sizing: inherit;\"><span class=\"hs-cta-node hs-cta-4cb5564e-c2a0-4b14-9e5b-0afed2b05677\" id=\"hs-cta-4cb5564e-c2a0-4b14-9e5b-0afed2b05677\" data-hs-drop=\"true\" style=\"box-sizing: inherit; visibility: visible;\"><a id=\"cta_button_2025954_6c70c27e-c04e-4ef3-8242-9643aa4ac787\" class=\"cta_button\" href=\"https://blog.swantonweld.com/cs/c/?cta_guid=6c70c27e-c04e-4ef3-8242-9643aa4ac787&amp;signature=AAH58kFuwmuGZ7bubS75TJ_lnq3ENlKOtw&amp;pageId=56873488418&amp;placement_guid=4cb5564e-c2a0-4b14-9e5b-0afed2b05677&amp;click=bc75c769-74ce-469b-b611-662a9ecb7ed4&amp;hsutk=8f7242fb9d18db31b9f36e0742d8e4f2&amp;canon=https%3A%2F%2Fblog.swantonweld.com%2Frecruiting-talented-skilled-workers-college-degree-not-required&amp;portal_id=2025954&amp;redirect_url=APefjpFrDd0QnZljn1A8rs0LuoPaS4uOjpDjiB9FjWUjM42kRTcB0CHiP6Nl_yqQW5fi_rAxobDiVSYtOVPMpmGhD7dzbTp1Lg-IPGtdvkrkAO54fyFzjQAZz_5q0ed94EKcOP1SutSs&amp;__hstc=18271974.8f7242fb9d18db31b9f36e0742d8e4f2.1640113661349.1640113661349.1640113661349.1&amp;__hssc=18271974.1.1640113661349&amp;__hsfp=1665106123&amp;contentType=blog-post\" cta_dest_link=\"http://swantonweld.com/company/careers/\" style=\"color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation; vertical-align: middle; box-sizing: content-box !important;\"></a></span></span></p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">If you\'ve been looking for a way to jump to the head of the line and get your career started now, look no further than Swanton Welding.<a href=\"https://swantonweld.com/contact-us/\" style=\"box-sizing: inherit; color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation;\">&nbsp;Contact</a>&nbsp;our team today to learn more about the multitude of opportunities and on-the-job training that awaits you with a fulfilling and rewarding welding and fabrication career.</p>', 'Equipment', 13, 'Recruiting Talented Skilled Workers: College Degree Not Required', 'When many people consider a career change, the first obstacle they may see in their way is obtaining the right education. For many jobs, a college degree has wrongly been seen as the only gateway to something rewarding with a living wage. However, many are finding their way into rewarding and stimulating careers through on-the-job training and experience in a skilled trade.', NULL, 'Recruiting Talented Skilled Workers: College Degree Not Required', 'When many people consider a career change, the first obstacle they may see in their way is obtaining the right education. For many jobs, a college degree has wrongly been seen as the only gateway to something rewarding with a living wage. However, many are finding their way into rewarding and stimulating careers through on-the-job training and experience in a skilled trade.', 'https://skylarck.com/public/images/1974791295.jpeg', '2021-12-21 19:12:53', '2021-12-21 19:12:53'),
(21, 'choosing-a-career-as-a-fabricator', '1445714934.jpeg', 'Choosing a Career as a Fabricator', 'It\'s an exciting time to be involved with welding and fabrication. This is an industry that is expecting a 22 percent job growth over the next 10 years. Many considering a career in metalwork expect to face a huge learning curve — and there can be — but starting on that career path is easier when you have a partner like Swanton Welding Company on your side. With us, you can earn a wage while learning the trade and gaining valuable experience.', '2021-01-13', '<p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">While the common perception of modern metal fabrication is one of automated lines and robotics, the truth is there is still and will forever be a demand for the human element. The field requires skilled craftsmen who put their training to use alongside their creative and problem solving abilities to perform this job. No amount of technological innovation is going to change that anytime soon.</p><h2 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; line-height: 1.2em; font-size: 2.25em; font-family: &quot;Titillium Web&quot;, sans-serif;\">Something New Everyday</h2><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">The job description may sound straightforward enough, but that doesn\'t mean it\'s the same job day after day. Swanton Welding works on some of the most exciting and cutting-edge metal fabrication work being done in the United States. Monday you may be starting the assembly of a 50,000-lb. mixing tank, and by the end of the week you are putting the finishing touches on a 125,000-lb acid furnace. Not only will your physical skills be put to the test, but your mental and creative abilities, too. All the while, you\'ll be creating things that change people\'s lives in big and small ways.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">There\'s also a lot of opportunity for&nbsp;<a href=\"https://inbound.swantonweld.com/heavy-fabrication-capability-sheet\" rel=\"noopener\" style=\"box-sizing: inherit; color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation;\">metal fabricators</a>&nbsp;to carve out a career that they love. Possible occupations that grow out of a fabrication beginning include:</p><ul style=\"box-sizing: inherit; max-width: 80%; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\"><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\">Machinist</li><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\">Press operator</li><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\">CNC operator</li><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\">Welder</li><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\">Robot programmer</li><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\">CNC machine programmer</li><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\">CAD engineer or design</li><li aria-level=\"1\" style=\"box-sizing: inherit; margin-bottom: 0.5em;\">Estimator</li></ul><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">A company like Swanton Welding has a team of professionals as diverse as the different projects they handle in-house every week. They all share one goal — providing outstanding customer service and exceeding those customer\'s expectations in terms of quality.</p><h2 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; line-height: 1.2em; font-size: 2.25em; font-family: &quot;Titillium Web&quot;, sans-serif;\">Beginning a New Career with Swanton Welding</h2><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Inspiration to grow in your new career will be all around you at Swanton Welding. Most of our current leadership started their time at Swanton with little or no experience, and worked their way up. Aside from being 18 years old and having a high school diploma or GED, there are no other requirements to join our team. We offer both on-the-job and classroom training, and we don\'t require welders to be certified. For those that choose to pursue advancing their career, we have a Certified Welding Instructor on staff that can get you certified at no out-of-pocket cost.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Our leadership team worked their way up, earning their positions after putting in their time, exhibiting leadership qualities, and demonstrating their knowledge and skills. We strictly promote from within, meaning once you\'re on the Swanton Welding team, the sky\'s the limit. For all the changes in the job market over the last few years, welding and metal fabrication is one career that is here to stay.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Doing rewarding work for a team dedicated to one purpose makes for an outstanding career. Whether you are looking to make a career change, or you\'re someone who likes working with their hands and are still trying to figure out what you want to do, consider a career in metal fabrication and welding. If you think you\'ve got what it takes to be a part of our team, contact<a href=\"https://swantonweld.com/company/careers/\" style=\"box-sizing: inherit; color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation;\">&nbsp;Swanton Welding</a>. Let’s talk about your future today!</p>', 'Industrial', 13, 'Choosing a Career as a Fabricator', 'It\'s an exciting time to be involved with welding and fabrication. This is an industry that is expecting a 22 percent job growth over the next 10 years. Many considering a career in metalwork expect to face a huge learning curve — and there can be — but starting on that career path is easier when you have a partner like Swanton Welding Company on your side. With us, you can earn a wage while learning the trade and gaining valuable experience.', NULL, 'Choosing a Career as a Fabricator', 'It\'s an exciting time to be involved with welding and fabrication. This is an industry that is expecting a 22 percent job growth over the next 10 years. Many considering a career in metalwork expect to face a huge learning curve — and there can be — but starting on that career path is easier when you have a partner like Swanton Welding Company on your side. With us, you can earn a wage while learning the trade and gaining valuable experience.', 'https://skylarck.com/public/images/1445714934.jpeg', '2021-12-21 19:14:18', '2021-12-21 19:14:18');
INSERT INTO `blogs` (`id`, `url`, `image`, `tittle`, `blogshortdescription`, `blogdate`, `description`, `blogtags`, `blogcategoryid`, `mettatittle`, `metadescription`, `keywords`, `ogtittle`, `ogdescription`, `og_image`, `created_at`, `updated_at`) VALUES
(22, 'experience-determines-the-efficiency-of-your-fabrication-project', '1395589472.jpg', 'Experience Determines the Efficiency of Your Fabrication Project', 'No two fabrication projects are the same. From the idea to the finished product, you need to partner with a company who can see you through from start to finish, keep your timeline and budget on track, and address any issues that come up throughout the process. Finding the right partner with the right experience can help your project succeed.', '2020-11-23', '<h2 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; line-height: 1.2em; font-size: 2.25em; font-family: &quot;Titillium Web&quot;, sans-serif;\">Starting with an Idea</h2><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Ideas can start simply as a sketch on a piece of paper. Throughout the process those sketches are transformed into giant structures or sophisticated, specialized equipment. An experienced and qualified engineer can look at that sketch and begin to transform your vision into proper design drawings, engineered drawings, or architectural drawings.</p><h2 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; line-height: 1.2em; font-size: 2.25em; font-family: &quot;Titillium Web&quot;, sans-serif;\">Addressing the Variables in Your Fabrication Project</h2><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Every project is different. There are many variables that go into nearly every fabrication project. Ideally, all variables would be addressed during the planning phase. Yet there are many times when the variables aren’t uncovered until later in the project, sometimes not until the project is being built, or even after the build is finished. Discovering these issues later in the process will lead to more cost and an extended timeline. Looking for, identifying, and addressing these variables ahead of time require an experienced fabrication partner.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\"><span class=\"hs-cta-wrapper\" id=\"hs-cta-wrapper-87d6e502-fefd-449e-8895-e80f8cff9939\" style=\"box-sizing: inherit;\"><span class=\"hs-cta-node hs-cta-87d6e502-fefd-449e-8895-e80f8cff9939\" id=\"hs-cta-87d6e502-fefd-449e-8895-e80f8cff9939\" data-hs-drop=\"true\" style=\"box-sizing: inherit; visibility: visible;\"><a id=\"cta_button_2025954_897562b5-17fd-4e3e-a5a0-2e12ace5bd3c\" class=\"cta_button\" href=\"https://blog.swantonweld.com/cs/c/?cta_guid=897562b5-17fd-4e3e-a5a0-2e12ace5bd3c&amp;signature=AAH58kFWQeEhhUtLlTCDEyt91zdEQFt0ow&amp;pageId=39079453313&amp;placement_guid=87d6e502-fefd-449e-8895-e80f8cff9939&amp;click=b76af253-1399-4dcc-a447-12a8bca41e4e&amp;hsutk=170de1665705d264f7e0519475a9ee8d&amp;canon=https%3A%2F%2Fblog.swantonweld.com%2Fexperience-determines-the-efficiency-of-your-fabrication-project&amp;portal_id=2025954&amp;redirect_url=APefjpEojBJIKJw2aR9ec-BUdaW2JI8NF7wB-6Q2XvtmXYxjT8efq-VC9ZGKd6x05M7S6OdXkR_Nr4U6ATkW2lotH3rwri9WsFZt0yOD0YSwp-otf8mbxdSsr5IaA9sZ_1h-0Wi7gWBIL--whju5DPGCPPsVZLox92zU1tSjj_hw4uR-FgeU9Ys&amp;__hstc=18271974.170de1665705d264f7e0519475a9ee8d.1640113681492.1640113681492.1640113681492.1&amp;__hssc=18271974.1.1640113681493&amp;__hsfp=1665106123&amp;contentType=blog-post\" cta_dest_link=\"http://inbound.swantonweld.com/heavy-fabrication-capability-sheet\" style=\"color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation; vertical-align: middle; box-sizing: content-box !important;\"></a></span></span></p><h2 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; line-height: 1.2em; font-size: 2.25em; font-family: &quot;Titillium Web&quot;, sans-serif;\">Working with the Right Fabricator to See Your Vision Through</h2><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Proper drawings from the engineering team will allow the fabrication team to estimate the timeline and budget for the project, identify the materials needed, determine the proper equipment and methods needed, look for areas that can be improved or optimized, and identify any potential pitfalls that may occur during the process. Working with the&nbsp;<a href=\"https://blog.swantonweld.com/choosing-a-metal-fab-company\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: inherit; color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation;\">right fabricator&nbsp;</a>means that everything you need can happen with one partner. Working with one partner who can handle your project from beginning to end means easier project management, lower cost, and a faster timeline.</p><h2 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; line-height: 1.2em; font-size: 2.25em; font-family: &quot;Titillium Web&quot;, sans-serif;\">The Benefit of Experience</h2><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">That original rough sketch isn’t sufficient enough to begin production, but in-house engineers in a fabrication team can take those rough sketches, review the project, point out areas for improvement, and get your project started on the right track. In the hands of an experienced fabrication team, a skilled fabricator can begin to ask the right questions and guide you in the right direction through each step, from getting the proper drawings created to having your project completed for the right price, with the highest quality.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\"><span class=\"hs-cta-wrapper\" id=\"hs-cta-wrapper-328363ba-04ba-4818-b890-c2f8ab565fa7\" style=\"box-sizing: inherit;\"><span class=\"hs-cta-node hs-cta-328363ba-04ba-4818-b890-c2f8ab565fa7\" id=\"hs-cta-328363ba-04ba-4818-b890-c2f8ab565fa7\" data-hs-drop=\"true\" style=\"box-sizing: inherit; visibility: visible;\"><a id=\"cta_button_2025954_b839bdc6-3c68-4108-8ffa-eeb22ff10a7e\" class=\"cta_button\" href=\"https://blog.swantonweld.com/cs/c/?cta_guid=b839bdc6-3c68-4108-8ffa-eeb22ff10a7e&amp;signature=AAH58kGFbokzct7zsWvt6X2rs250-ZEtmg&amp;pageId=39079453313&amp;placement_guid=328363ba-04ba-4818-b890-c2f8ab565fa7&amp;click=51244c4b-0de2-4d5c-b4c6-b872b3044728&amp;hsutk=170de1665705d264f7e0519475a9ee8d&amp;canon=https%3A%2F%2Fblog.swantonweld.com%2Fexperience-determines-the-efficiency-of-your-fabrication-project&amp;portal_id=2025954&amp;redirect_url=APefjpEQoygzRz_Tb7MdRgTsohT0no1Z-VPfiOMmaaz1IRyB5ezgSVriNkvkdO0nEOydC3xCEU1ftWt-7N9mXbDGg2mK8b86_FmnIGD0J5Ce2hHQP58_-yKlYzLAWTlAzKmljvZWNvBNpUaupZjDI7bcoKUcODJJG0tdjBjpmSsS8rrTch3VQq0&amp;__hstc=18271974.170de1665705d264f7e0519475a9ee8d.1640113681492.1640113681492.1640113681492.1&amp;__hssc=18271974.1.1640113681493&amp;__hsfp=1665106123&amp;contentType=blog-post\" target=\"_blank\" rel=\"noopener\" cta_dest_link=\"http://blog.swantonweld.com/hubfs/PDFs/Infographics/Swanton_Infographic.pdf\" style=\"color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation; vertical-align: middle; box-sizing: content-box !important;\"></a></span></span></p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Swanton Welding has spent over 60 years fine tuning this process. We know the right questions to ask. We have the resources to help you move your ideas from concept to final product. In fact, the facilities we’ve built, the equipment we use, and our team of skilled professionals are all the result of the needs our customers have presented to us over the years. Let our experience and expertise guide you and your fabrication project from concept to completion.&nbsp;<a href=\"https://seagatealarm.com/contact-us/\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: inherit; color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation;\">Contact us</a>&nbsp;for a free quote today.</p>', 'Equipment', 13, 'Experience Determines the Efficiency of Your Fabrication Project', 'No two fabrication projects are the same. From the idea to the finished product, you need to partner with a company who can see you through from start to finish, keep your timeline and budget on track, and address any issues that come up throughout the process. Finding the right partner with the right experience can help your project succeed.', NULL, 'Experience Determines the Efficiency of Your Fabrication Project', 'No two fabrication projects are the same. From the idea to the finished product, you need to partner with a company who can see you through from start to finish, keep your timeline and budget on track, and address any issues that come up throughout the process. Finding the right partner with the right experience can help your project succeed.', 'https://skylarck.com/public/images/1395589472.jpg', '2021-12-21 19:16:21', '2021-12-21 19:16:21'),
(23, 'how-engineers-can-help-move-your-fabrication-project', '1882131696.jpeg', 'How Engineers Can Help Move Your Fabrication Project', 'Your company has the idea. You even have the drawings, but maybe they lack the level of detail needed to get production moving. Not every custom metal fabrication shop has the capabilities necessary to help you get to the finish line. You may even think you can’t get your project off the ground without all the details ready beforehand. Your situation is clear: you have a project and with a looming deadline, and you feel stuck. Without the right fabrication partner, your project may never get past the theoretical stage. Custom fabrication shops may have tons of experience and a variety of capabilities, but without on-site engineers they may not be able to fill in the gaps still looming in your design. To get your idea from concept to production most efficiently, look for a team with an engineering department in house.', '2020-04-29', '<h2 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; line-height: 1.2em; font-size: 2.25em; font-family: &quot;Titillium Web&quot;, sans-serif;\">Our Engineers Begin with a Thorough Review</h2><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Your partnership will begin with our team of engineers who will analyze and review the drawings you provide to us, along with any specifications including materials. Our engineers will take this information, note any potential issues including problems with the current supply chain, and provide our recommendations. Our engineering team can suggest alternative materials that will work in the case of a supply chain interruption or shortage. Once the initial review is completed, we can help to make sure your design is as efficient as possible. Our engineers will strive to use the most efficient amount of parts and materials and will make sure that your components can be manufactured in this fashion. After our review, we will be able to take your design and specifications, combine them with our knowledge, and quote your project accurately.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\"><span class=\"hs-cta-wrapper\" id=\"hs-cta-wrapper-328363ba-04ba-4818-b890-c2f8ab565fa7\" style=\"box-sizing: inherit;\"><span class=\"hs-cta-node hs-cta-328363ba-04ba-4818-b890-c2f8ab565fa7\" id=\"hs-cta-328363ba-04ba-4818-b890-c2f8ab565fa7\" data-hs-drop=\"true\" style=\"box-sizing: inherit; visibility: visible;\"><a id=\"cta_button_2025954_b839bdc6-3c68-4108-8ffa-eeb22ff10a7e\" class=\"cta_button\" href=\"https://blog.swantonweld.com/cs/c/?cta_guid=b839bdc6-3c68-4108-8ffa-eeb22ff10a7e&amp;signature=AAH58kG8eOPMLZheQ8MJm767RmPpcfvY_w&amp;pageId=41598441937&amp;placement_guid=328363ba-04ba-4818-b890-c2f8ab565fa7&amp;click=658858dd-6289-4e94-975a-93ce5a685f42&amp;hsutk=8213dc397e43cdd873390cd6e70f3061&amp;canon=https%3A%2F%2Fblog.swantonweld.com%2Fhow-engineers-can-help-move-your-fabrication-project&amp;portal_id=2025954&amp;redirect_url=APefjpErA1P34-w2S8W95wcmJjhj0ZHOXvr0FGANcce0igqUbybi67PGCTnmvvVNtoZz472WCqDKfXYiCaCsdr9hhXjJ569P6g_kiZoxtNp0oEQQTg6hajoAUFJ7KD1TAk_g-iSQNvOPiCkCRyrhssrXCw71Cd7QXExNS3VnpKNRZX0ZRhzwya0&amp;__hstc=18271974.8213dc397e43cdd873390cd6e70f3061.1640113684417.1640113684417.1640113684417.1&amp;__hssc=18271974.1.1640113684417&amp;__hsfp=1665106123&amp;contentType=blog-post\" target=\"_blank\" rel=\"noopener\" cta_dest_link=\"http://blog.swantonweld.com/hubfs/PDFs/Infographics/Swanton_Infographic.pdf\" style=\"color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation; vertical-align: middle; box-sizing: content-box !important;\"></a></span></span></p><h2 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; line-height: 1.2em; font-size: 2.25em; font-family: &quot;Titillium Web&quot;, sans-serif;\">Moving to Project Management</h2><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Once our engineers have taken your idea through the design stage, your project will move into the production phase. A dedicated project manager will work with the fabrication team to manage your project from start to finish. Because every project can have moments where things don’t go as planned, having an engineering team on site with knowledge of the project, a plan in place, and solutions at the ready is the best way to address any issues that may arise during fabrication. Because our team works seamlessly with yours, the risk of errors is minimized, and testing throughout the process ensures that you will have a high-quality product when your project is completed.</p><h2 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; color: rgb(51, 51, 51); padding: 0px; line-height: 1.2em; font-size: 2.25em; font-family: &quot;Titillium Web&quot;, sans-serif;\">Your Project Will Be a Customer Driven Experience</h2><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Swanton Welding has been innovative and customer-driven since 1956. We know that not every single tube or bin will be used in the same way and that every project is unique and should be treated as such. Working closely with our technicians, welders, and fabrication teams, our engineers make sure your wishes are communicated and adhered to as your project moves forward.</p><p><span class=\"hs-cta-wrapper\" id=\"hs-cta-wrapper-87d6e502-fefd-449e-8895-e80f8cff9939\" style=\"box-sizing: inherit; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\"><span class=\"hs-cta-node hs-cta-87d6e502-fefd-449e-8895-e80f8cff9939\" id=\"hs-cta-87d6e502-fefd-449e-8895-e80f8cff9939\" data-hs-drop=\"true\" style=\"box-sizing: inherit; visibility: visible;\"><a id=\"cta_button_2025954_897562b5-17fd-4e3e-a5a0-2e12ace5bd3c\" class=\"cta_button\" href=\"https://blog.swantonweld.com/cs/c/?cta_guid=897562b5-17fd-4e3e-a5a0-2e12ace5bd3c&amp;signature=AAH58kHKM0wYGutVNZWidBPmk0VWu4Hw9Q&amp;pageId=41598441937&amp;placement_guid=87d6e502-fefd-449e-8895-e80f8cff9939&amp;click=416ff72a-adfa-4c26-bc3d-31d0aa5f2c87&amp;hsutk=8213dc397e43cdd873390cd6e70f3061&amp;canon=https%3A%2F%2Fblog.swantonweld.com%2Fhow-engineers-can-help-move-your-fabrication-project&amp;portal_id=2025954&amp;redirect_url=APefjpFuVe_A9L8CthOrLj8jACR_zbuy--oTtUEhu-G5Qta4l-pXR-pe28Jj9UCB5ET8YKYgq-F-UarhoC5IUE8cumbfoQxsKQ4_hTPimoVfL2sqbRTgMT0ujsIQ6yJxkYp6gnfKfJV6kxIBz_HB_YYAiblj8U-1tdK9QpjKKx0qYHpxfpEdnB0&amp;__hstc=18271974.8213dc397e43cdd873390cd6e70f3061.1640113684417.1640113684417.1640113684417.1&amp;__hssc=18271974.1.1640113684417&amp;__hsfp=1665106123&amp;contentType=blog-post\" cta_dest_link=\"http://inbound.swantonweld.com/heavy-fabrication-capability-sheet\" style=\"color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation; vertical-align: middle; box-sizing: content-box !important;\"></a></span></span><span style=\"color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\"></span></p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Having an<a href=\"https://blog.swantonweld.com/certified-welders-make-a-positive-impact-on-your-project\" rel=\"noopener\" style=\"box-sizing: inherit; color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation;\">&nbsp;in-house CWI</a>&nbsp;(Certified Welding Inspector) to closely monitor the project throughout will ensure that every part of your product is made with the greatest attention to detail and excellent precision. Having a CWI on site throughout the project will make certain that the fabrication of your project will exceed your expectations.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; line-height: 1.5em; color: rgb(119, 119, 119); font-family: &quot;Titillium Web&quot;, sans-serif;\">Swanton Welding’s dedicated engineering team and our in-house CWI makes it possible for those with the drawings and ideas to see their products through to completion. At Swanton Welding, we have the comprehensive, complete, and experienced team to provide the highest quality services for your next project.&nbsp;<a href=\"https://swantonweld.com/get-a-quote/\" rel=\"noopener\" style=\"box-sizing: inherit; color: rgb(184, 15, 0); text-decoration-line: underline; touch-action: manipulation;\">Contact us today</a>&nbsp;for more information about our custom fabrication capabilities.</p>', 'Industrial', 13, 'How Engineers Can Help Move Your Fabrication Project', 'Your company has the idea. You even have the drawings, but maybe they lack the level of detail needed to get production moving. Not every custom metal fabrication shop has the capabilities necessary to help you get to the finish line. You may even think you can’t get your project off the ground without all the details ready beforehand. Your situation is clear: you have a project and with a looming deadline, and you feel stuck. Without the right fabrication partner, your project may never get past the theoretical stage. Custom fabrication shops may have tons of experience and a variety of capabilities, but without on-site engineers they may not be able to fill in the gaps still looming in your design. To get your idea from concept to production most efficiently, look for a team with an engineering department in house.', NULL, 'How Engineers Can Help Move Your Fabrication Project', 'Your company has the idea. You even have the drawings, but maybe they lack the level of detail needed to get production moving. Not every custom metal fabrication shop has the capabilities necessary to help you get to the finish line. You may even think you can’t get your project off the ground without all the details ready beforehand. Your situation is clear: you have a project and with a looming deadline, and you feel stuck. Without the right fabrication partner, your project may never get past the theoretical stage. Custom fabrication shops may have tons of experience and a variety of capabilities, but without on-site engineers they may not be able to fill in the gaps still looming in your design. To get your idea from concept to production most efficiently, look for a team with an engineering department in house.', 'https://skylarck.com/public/images/1882131696.jpeg', '2021-12-21 19:18:05', '2021-12-21 19:18:05');
