(25, 'graphic-designer', 'Metal sheet Rolling machine', 'In publishing and graphic design, Lorem ipsum is a placeholder text commonly used to demonstrate the visual form of a document or a typeface without relying on meaningful content. Lorem ipsum may be used as a placeholder before the final copy is available. Wikipedia\r\n', '<div class=\"row\" style=\"color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px;\"><div class=\"container\" style=\"width: 1170px;\"><div class=\"col-xs-12\" style=\"position: relative; min-height: 1px; padding-right: 15px; padding-left: 15px; float: left; width: 1140px;\"><h2 class=\"services-sub-headings\" style=\"box-sizing: border-box; font-family: &quot;Open Sans&quot;, sans-serif; font-weight: 600; line-height: 28px; color: rgb(68, 68, 68); margin: 0px; font-size: 22px; text-align: center; padding: 25px 0px;\">Our Design For Your Business Achievement</h2><h2 class=\"services-sub-headings\" style=\"box-sizing: border-box; font-family: &quot;Open Sans&quot;, sans-serif; font-weight: 600; line-height: 28px; color: rgb(68, 68, 68); margin: 0px; font-size: 22px; text-align: center; padding: 25px 0px;\"><div class=\"row\" style=\"color: rgb(102, 102, 102); font-size: 13px; font-weight: 300; text-align: start;\"><div class=\"container\" style=\"width: 1170px;\"><div class=\"col-xs-12\" style=\"position: relative; min-height: 1px; padding-right: 15px; padding-left: 15px; float: left; width: 1140px;\"><p class=\"services-paragraph\" style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; font-size: 15px; line-height: 22px;\">We at Elexoft, provide premium sort of graphic design services all over Pakistan. Our graphic designers are not only expert in graphic designing but also they’re up-to-date as far as web promotion is concerned. So here you can get multiple benefits under a table which is our specialty. Elexoft is known for producing best logo design in Pakistan.</p></div></div></div></h2><h2 class=\"services-sub-headings-2\" style=\"font-weight: 600; line-height: 28px; color: rgb(68, 68, 68); margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 22px; padding-bottom: 25px;\">Flyer and Brochures</h2><h2 class=\"services-sub-headings\" style=\"font-weight: 600; line-height: 28px; color: rgb(68, 68, 68); margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 22px; text-align: center; padding: 25px 0px;\"><div class=\"row light-grey-bgcolor main-services-section\" style=\"background: rgb(250, 250, 250); padding: 20px 0px; margin-top: 30px; color: rgb(102, 102, 102); font-size: 13px; font-weight: 300; text-align: start;\"><div class=\"container\" style=\"width: 1170px;\"><div class=\"col-xs-12 col-sm-9\" style=\"min-height: 1px; float: left; width: 855px;\"><p class=\"services-paragraph-2\" style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; font-size: 17px; line-height: 28px;\">Distinctive kinds of flyer designs are missing in Pakistan and we are here to bring much needed style and class in brochures which will surely attract customers at will. If you’re looking for some of the eye- catching flyers and brochures, let Elexoft know and leave the rest to you as we’ve got all covered for your convenience. Not only we will provide you contemporary and ingenious flyers, but we will come up with such a marketing plan that will turn the table around as far as branding and advertising is concerned. Through our best logo designers and graphic designers, we’ll produce your message in such a crafty way that it will appear to be so pleasing on the eye and at the same moment so appealing as well.</p></div><div class=\"col-xs-12 col-sm-3\" style=\"min-height: 1px; float: left; width: 285px;\"><img src=\"https://www.elexoft.com/assets/services/flyer.png\" alt=\"Flyer and Brochures\" class=\"services-img pull-right\" style=\"border: 0px; max-width: 250px; height: auto; float: right; margin-bottom: 20px;\"></div></div></div><div class=\"row main-services-section\" style=\"padding: 20px 0px; margin-top: 30px; color: rgb(102, 102, 102); font-size: 13px; font-weight: 300; text-align: start;\"><div class=\"container\" style=\"width: 1170px;\"><div class=\"col-xs-12 col-sm-3\" style=\"min-height: 1px; float: left; width: 285px;\"><img src=\"https://www.elexoft.com/assets/services/logoDesigning.png\" alt=\"Logo Designing\" class=\"services-img\" style=\"border: 0px; max-width: 250px; height: auto; margin-bottom: 20px;\"></div></div></div></h2><h2 class=\"services-sub-headings-2\" style=\"font-weight: 600; line-height: 28px; color: rgb(68, 68, 68); margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 22px; padding-bottom: 25px;\">Logo Design</h2><h2 class=\"services-sub-headings\" style=\"font-weight: 600; line-height: 28px; color: rgb(68, 68, 68); margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 22px; text-align: center; padding: 25px 0px;\"><div class=\"row main-services-section\" style=\"padding: 20px 0px; margin-top: 30px; color: rgb(102, 102, 102); font-size: 13px; font-weight: 300; text-align: start;\"><div class=\"container\" style=\"width: 1170px;\"><div class=\"col-xs-12 col-sm-9\" style=\"min-height: 1px; float: left; width: 855px;\"><p class=\"services-paragraph-2\" style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; font-size: 17px; line-height: 28px;\">Elexoft is a hub of best logo designs as we have got all what is required to make marked and note- worthy logos. We will make your business a big thing by producing palpable logo which will make your identity all over Pakistan. There are so many hurdles which people often face in logo design that logos are usually not effectively communicative due to which organizations faces so many issues but our foremost task is to produce such types of logo which can stick to anyone’s mind and by just imagining about the logo, customer can think of whole organization and logo will be symbol of elegance.</p></div></div></div></h2></div></div></div>', '1399287585.jpg', '1101954739.jpg', 'Graphic Desiginer', 'A visual identity that will allow you to stand out, attract attention and shine in your own way in an already very popular market. An identity that generates results that exceed expectations. For this, we believes that design, in addition to its aesthetic role, must above all be at the service of functionality. Elexoft offers the evolution and creation of brand images that will allow you to define the future of your', NULL, 'Graphic Desiginer', 'A visual identity that will allow you to stand out, attract attention and shine in your own way in an already very popular market. An identity that generates results that exceed expectations. For this, we believes that design, in addition to its aesthetic role, must above all be at the service of functionality. Elexoft offers the evolution and creation of brand images that will allow you to define the future of your', 'http://localhost/laraveladminauth/public/images/822833882.jpg', '2020-12-05 06:35:01', '2021-12-15 12:57:19'),
(26, 'over-head-crane-issues', 'Over Head Crane Issues', 'Sky Lark Industrial equipment trading LLC Dubai United Arab Emirates is a professional crane service company dedicated to providing complete installation, repair & maintenance services for industrial and workshop cranes, conventional power plant cranes, EOT cranes, gantry cranes, overhead cranes, Jib cranes etc. We are specializes in providing crane solution for a diverse range of clients and industries.', '<p style=\"text-align: center; \"><span style=\"font-size: 24px;\"><b>Professional digital marketing services that generate results</b></span></p><p style=\"text-align: left;\">We are crackerjack of our field and we are proficient when it comes to web development and marketing aspects. We’ve been providing superlative sort of digital marketing services in Pakistan. We know what is required to make your business a sensation and we have highly skillful team which can turn the table around as far as your business growth is concerned. SEO technique is something which is essential to make a brand grow and we have SEO specialist from all over Pakistan. We will help you, thus, to achieve commercial success through conversations with Internet users. Only in this way will you seduce even the most skeptical of your targets. It is all the magic of digital marketing, and it is also our know-how. Our digital marketing services agency aims to help companies develop their activities through the internet. This is why we offer website creation services, account management on social networks, computer graphics, web referencing, traffic acquisition, internet advertising, digital strategy and support. In fact, more than 80% of the world\'s population is connected to the Internet. It is for this purpose that we help and support SMEs in their digital transformation. In addition, our services aim to increase your visibility, improve your reputation and increase your turnover.<br></p><p style=\"text-align: center; \"><br></p>', '1541045674.jpeg', '1991234180.jpeg', 'SEO', 'Search engine optimization is the process of improving the quality and quantity of website traffic to a website or a web page from search engines.', '', 'SEO', 'Search engine optimization is the process of improving the quality and quantity of website traffic to a website or a web page from search engines.', 'https://sarcksolution.com/public/images/500873009.jpg', '2020-12-05 06:41:38', '2022-04-03 03:53:26'),
(27, 'customer-relation-manegment', 'Electrical Control Panel', 'In publishing and graphic design, Lorem ipsum is a placeholder text commonly used to demonstrate the visual form of a document or a typeface without relying on meaningful content. Lorem ipsum may be used as a placeholder before the final copy is available. Wikipedia\r\n', '<p>Customer relationship management is the process of managing interactions with existing as well as past and potential customers. It is one of many different approaches that allow a company to manage and analyse its own interactions with its past, current and potential customers.<br></p>', '481723234.jpg', '2129648457.jpg', 'Customer Relation Management', 'Customer relationship management is the process of managing interactions with existing as well as past and potential customers. It is one of many different approaches that allow a company to manage and analyse its own interactions with its past, current and potential customers.', NULL, 'Customer Relation Management', 'Customer relationship management is the process of managing interactions with existing as well as past and potential customers. It is one of many different approaches that allow a company to manage and analyse its own interactions with its past, current and potential customers.', 'http://localhost/laraveladminauth/public/images/462618261.jpg', '2020-12-07 04:02:05', '2021-12-15 13:02:36'),
(28, 'digital-marketing', 'Welding Machine', 'In publishing and graphic design, Lorem ipsum is a placeholder text commonly used to demonstrate the visual form of a document or a typeface without relying on meaningful content. Lorem ipsum may be used as a placeholder before the final copy is available. Wikipedia\r\n', '<div style=\"margin-top:80px;margin-bottom:80px;\">\r\n<h2 class=\"services-sub-headings\" style=\"font-family: &quot;Open Sans&quot;, sans-serif; line-height: 28px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 22px; text-align: center; padding: 25px 0px;\"><span style=\"font-size: 24px;\"><b>Professional digital marketing services that generate results</b></span></h2><div><span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 17px;\">We are crackerjack of our field and we are proficient when it comes to web development and marketing aspects. We’ve been providing superlative sort of digital marketing services in Pakistan. We know what is required to make your business a sensation and we have highly skillful team which can turn the table around as far as your business growth is concerned. SEO technique is something which is essential to make a brand grow and we have SEO specialist from all over Pakistan.</span><br style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 17px;\"><span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 17px;\">We will help you, thus, to achieve commercial success through conversations with Internet users. Only in this way will you seduce even the most skeptical of your targets. It is all the magic of digital marketing, and it is also our know-how.</span><br style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 17px;\"><span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 17px;\">Our digital marketing services agency aims to help companies develop their activities through the internet. This is why we offer website creation services, account management on social networks, computer graphics, web referencing, traffic acquisition, internet advertising, digital strategy and support.</span><br style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 17px;\"><span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 17px;\">In fact, more than 80% of the world\'s population is connected to the Internet. It is for this purpose that we help and support SMEs in their digital transformation. In addition, our services aim to increase your visibility, improve your reputation and increase your turnover.</span></div><div><br></div><div><span style=\"font-size: 18px;\"><span style=\"font-size: 24px;\">﻿</span><b><span style=\"font-size: 24px;\">Paid SEO or SEA</span></b></span></div><div><span style=\"font-size: 18px;\"><b><span style=\"font-size: 24px;\"><br></span></b></span></div><div><span style=\"font-size: 18px;\">This is \"Search Engine Advertising\". This referencing is more akin to advertising. </span></div><div><span style=\"font-size: 18px;\">Through campaigns, a company will pay to position itself on words or expressions. On Google, we will talk about Google AdWords. The difficulty: the relevance and design of these campaigns. They are billed in CPC (Cost per Click), CPM (Cost Part Thousand), CPL (Cost per Lead) or CPA (Cost per Action). It is therefore essential to deploy well-targeted campaigns to make them profitable.</span></div><div><span style=\"font-size: 18px;\"> SEA requires a good knowledge of the target market as well as a good knowledge of user behavior. Analyzing navigation data and AdWords campaigns can be very useful. They are preferred for immediate and punctual communication.</span></div><div><span style=\"font-size: 18px;\"><br></span></div><div><span style=\"font-size: 24px;\"><b>﻿Web Analytics: data for digital marketing</b></span></div><div><span style=\"font-size: 24px;\"><b><br></b></span></div><div><span style=\"font-size: 18px;\">When a company has a website, it can analyze which acquisition channel it generates the most traffic. In digital, the navigation of Internet users is very volatile. Analysis of this data therefore makes it possible to better understand its audience and improve its customer relationship. </span></div><div><span style=\"font-size: 18px;\">The use and analysis of navigation data makes it possible to draw up a portrait of the different profiles of customers interested in your brand or your company. These DATA are therefore precious, because they allow more relevance in terms of digital communication. Whether it is to validate a communication campaign, or to define a new one, data analysis is essential. In the digital sector, this data is the most precious resource. Learn to interpret and use them to increase your audience. Through training, we will allow you to decrypt and use this data to refine your digital strategy and thus improve the visibility of your online site.</span><br><br><br><br></div></div>', '894718287.jpg', '985842301.jpg', 'Digital Marketing | Sarck Solution', 'Digital marketing is the component of marketing that utilizes internet and online based digital technologies such as desktop computers, mobile phones and other digital media and platforms to promote products and services.', 'Sarck Solution,sarck,solution,sarck solution,Top software house In Pakistan, Software House, Software company, SEO services company, web Development, Android App Development, IOS App Development, digital marketing services,IT company	,IT Services Company,it consulting companies,top it companies,it outsourcing companies,indian it,best it companies,biggest it companies,largest it companies,fortune 500 it companies,big it companies,it solutions consulting,best it consulting firms,top 100 it companies,top it staffing firms,marketing, seo, target ad, digital marketing, affiliate marketing,social media marketing, marketing strategy, email marketing,', 'Digital Marketing | Sarck Solution', 'Digital marketing is the component of marketing that utilizes internet and online based digital technologies such as desktop computers, mobile phones and other digital media and platforms to promote products and services.', 'https://sarcksolution.com/public/images/2002863161.jpg', '2020-12-07 04:06:41', '2021-12-15 13:03:20'),
(29, 'mobile-apps', 'Air Compressor', 'In publishing and graphic design, Lorem ipsum is a placeholder text commonly used to demonstrate the visual form of a document or a typeface without relying on meaningful content. Lorem ipsum may be used as a placeholder before the final copy is available. Wikipedia\r\n', '<p><span style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif;\">A&nbsp;</span><b style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif;\">mobile application</b><span style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif;\">&nbsp;(also called a&nbsp;</span><b style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif;\">mobile app</b><span style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif;\">) is a type of&nbsp;</span><b style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif;\">application</b><span style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif;\">&nbsp;designed to run on a&nbsp;</span><b style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif;\">mobile</b><span style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif;\">&nbsp;device, which can be a smartphone or tablet computer. Even if&nbsp;</span><b style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif;\">apps</b><span style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif;\">&nbsp;are usually small software units with limited function, they still manage to provide users with quality services and experiences.</span><br></p>', '1594150890.jpg', '1789563456.jpg', 'Mobile Apps', 'A mobile application (also called a mobile app) is a type of application designed to run on a mobile device, which can be a smartphone or tablet computer. Even if apps are usually small software units with limited function, they still manage to provide users with quality services and experiences.', NULL, 'Mobile Apps', 'A mobile application (also called a mobile app) is a type of application designed to run on a mobile device, which can be a smartphone or tablet computer. Even if apps are usually small software units with limited function, they still manage to provide users with quality services and experiences.', 'http://localhost/laraveladminauth/public/images/678098548.png', '2020-12-07 04:09:12', '2021-12-15 13:04:13'),
(30, 'all-type-of-ac-duct-system', 'All Type of AC Duct Machine System', 'In publishing and graphic design, Lorem ipsum is a placeholder text commonly used to demonstrate the visual form of a document or a typeface without relying on meaningful content. Lorem ipsum may be used as a placeholder before the final copy is available. Wikipedia\r\n', '<p>The Stripe API is organized around REST. Our API has predictable resource-oriented URLs, accepts form-encoded request bodies, returns JSON-encoded ..<br></p>', '153367367.jpg', '2064008742.jpg', 'Stripe APIs', 'The Stripe API is organized around REST. Our API has predictable resource-oriented URLs, accepts form-encoded request bodies, returns JSON-encoded ..', NULL, 'Stripe APIs', 'The Stripe API is organized around REST. Our API has predictable resource-oriented URLs, accepts form-encoded request bodies, returns JSON-encoded ..', 'http://localhost/laraveladminauth/public/images/459947910.png', '2020-12-07 04:35:14', '2021-12-15 13:11:11'),
