(1, 'codeigniter', 'CodeIgniter', '825650455.png', '<p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">CodeIgniter is an application development framework, which can be used to develop websites, using PHP. It is an Open Source framework. It has a very rich set of functionality, which will increase the speed of website development work.</p><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">If you know PHP well, then CodeIgniter will make your task easier. It has a very rich set of libraries and helpers. By using CodeIgniter, you will save a lot of time, if you are developing a website from scratch. Not only that, a website built in CodeIgniter is secure too, as it has the ability to prevent various attacks that take place through websites.</p><h2 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 23px; line-height: 2rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">CodeIgniter Features</h2><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Some of the important features of CodeIgniter are listed below −</p><ul class=\"list\" style=\"color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma; margin-bottom: 0rem !important;\"><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Model-View-Controller Based System</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Extremely Light Weight</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Full Featured database classes with support for several platforms.</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Query Builder Database Support</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Form and Data Validation</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Security and XSS Filtering</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Session Management</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Email Sending Class. Supports Attachments, HTML/Text email, multiple protocols (sendmail, SMTP, and Mail) and more.</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Image Manipulation Library (cropping, resizing, rotating, etc.). Supports GD, ImageMagick, and NetPBM</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">File Uploading Class</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">FTP Class</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Localization</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Pagination</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Data Encryption</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Benchmarking</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Full Page Caching</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Error Logging</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Application Profiling</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Calendaring Class</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">User Agent Class</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Zip Encoding Class</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Template Engine Class</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Trackback Class</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">XML-RPC Library</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Unit Testing Class</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Search-engine Friendly URLs</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Flexible URI Routing</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Support for Hooks and Class Extensions</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Large library of “helper” functions</p></li></ul>', 'CodeIgniter - Overview - Sarck Solution', 'CodeIgniter - Overview - CodeIgniter is an application development framework, which can be used to develop websites, using PHP.', NULL, 'CodeIgniter - Overview - Sarck Solution', 'CodeIgniter - Overview - CodeIgniter is an application development framework, which can be used to develop websites, using PHP.', 'https://sarcksolution.com/public/images/logo.jpg', '2020-12-06 04:27:36', '2020-12-19 10:28:14'),
(2, 'php', 'PHP', '380256479.png', '<p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">The&nbsp;<span style=\"font-weight: 640;\">PHP Hypertext Preprocessor (PHP)</span>&nbsp;is a programming language that allows web developers to create dynamic content that interacts with databases. PHP is basically used for developing web based software applications. This tutorial helps you to build your base with PHP.</p><h2 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 23px; line-height: 2rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Why to Learn PHP?</h2><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\"><span style=\"font-weight: 640;\">PHP</span>&nbsp;started out as a small open source project that evolved as more and more people found out how useful it was. Rasmus Lerdorf unleashed the first version of PHP way back in 1994.</p><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\"><span style=\"font-weight: 640;\">PHP</span>&nbsp;is a MUST for students and working professionals to become a great Software Engineer specially when they are working in Web Development Domain. I will list down some of the key advantages of learning PHP:</p><ul class=\"list\" style=\"color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma; margin-bottom: 0rem !important;\"><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">PHP is a recursive acronym for \"PHP: Hypertext Preprocessor\".</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">PHP is a server side scripting language that is embedded in HTML. It is used to manage dynamic content, databases, session tracking, even build entire e-commerce sites.</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">It is integrated with a number of popular databases, including MySQL, PostgreSQL, Oracle, Sybase, Informix, and Microsoft SQL Server.</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">PHP is pleasingly zippy in its execution, especially when compiled as an Apache module on the Unix side. The MySQL server, once started, executes even very complex queries with huge result sets in record-setting time.</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">PHP supports a large number of major protocols such as POP3, IMAP, and LDAP. PHP4 added support for Java and distributed object architectures (COM and CORBA), making n-tier development a possibility for the first time.</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">PHP is forgiving: PHP language tries to be as forgiving as possible.</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">PHP Syntax is C-Like.</p></li></ul><h2 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 23px; line-height: 2rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Characteristics of PHP</h2><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Five important characteristics make PHP\'s practical nature possible −</p><ul class=\"list\" style=\"color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma; margin-bottom: 0rem !important;\"><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\">Simplicity</li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\">Efficiency</li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\">Security</li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\">Flexibility</li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\">Familiarity</li></ul><h2 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 23px; line-height: 2rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Hello World using PHP.</h2><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Just to give you a little excitement about PHP, I\'m going to give you a small conventional PHP Hello World program, You can try it using Demo link.</p><div class=\"demo-view\" style=\"width: 716.547px; text-align: right; position: relative; top: 7px; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\"><a href=\"http://tpcg.io/qFWzNE\" target=\"_blank\" rel=\"nofollow\" class=\"demo\" style=\"background: rgb(1, 117, 114); color: rgb(255, 255, 255); font-family: &quot;Open Sans&quot;, Arial, sans-serif; padding: 3px 10px; border: 0px solid rgb(240, 92, 2); font-size: 13px !important; position: relative !important; right: unset !important; margin: -6px 17px 0px 0px !important;\"><i class=\"fa-external-link\" style=\"background: url(&quot;data:image/svg+xml;utf8, <svg xmlns=\\&quot;http://www.w3.org/2000/svg\\&quot; viewBox=\\&quot;0 0 576 512\\&quot;><path d=\\&quot;M195.515 374.828c-4.686-4.686-4.686-12.284 0-16.971l323.15-323.15-.707-.707-89.958.342c-6.627 0-12-5.373-12-12v-9.999c0-6.628 5.372-12 12-12L564 0c6.627 0 12 5.372 12 12l-.343 136c0 6.627-5.373 12-12 12h-9.999c-6.627 0-12-5.373-12-12L542 58.042l-.707-.707-323.15 323.15c-4.686 4.686-12.284 4.686-16.971 0l-5.657-5.657zm232-155.633l-8 8A12 12 0 0 0 416 235.68V464c0 8.837-7.164 16-16 16H48c-8.836 0-16-7.163-16-16V112c0-8.837 7.164-16 16-16h339.976c3.183 0 6.235-1.264 8.485-3.515l8-8c7.56-7.56 2.206-20.485-8.485-20.485H48C21.49 64 0 85.49 0 112v352c0 26.51 21.49 48 48 48h352c26.51 0 48-21.49 48-48V227.681c0-10.691-12.926-16.045-20.485-8.486z\\&quot;></path></svg>&quot;) no-repeat;\"></i>Live Demo</a></div><pre class=\"prettyprint notranslate prettyprinted\" style=\"font-family: monospace, monospace; font-size: 15px; border: 1px solid rgb(136, 136, 136); padding: 2px; color: rgba(0, 0, 0, 0.87); background: rgb(238, 238, 238) !important; margin-top: -5px !important;\"><span class=\"tag\" style=\"color: rgb(0, 0, 136);\">&lt;html&gt;</span><span class=\"pln\" style=\"color: rgb(0, 0, 0);\">\r\n   \r\n   </span><span class=\"tag\" style=\"color: rgb(0, 0, 136);\">&lt;head&gt;</span><span class=\"pln\" style=\"color: rgb(0, 0, 0);\">\r\n      </span><span class=\"tag\" style=\"color: rgb(0, 0, 136);\">&lt;title&gt;</span><span class=\"pln\" style=\"color: rgb(0, 0, 0);\">Hello World</span><span class=\"tag\" style=\"color: rgb(0, 0, 136);\">&lt;/title&gt;</span><span class=\"pln\" style=\"color: rgb(0, 0, 0);\">\r\n   </span><span class=\"tag\" style=\"color: rgb(0, 0, 136);\">&lt;/head&gt;</span><span class=\"pln\" style=\"color: rgb(0, 0, 0);\">\r\n\r\n   </span><span class=\"tag\" style=\"color: rgb(0, 0, 136);\">&lt;body&gt;</span><span class=\"pln\" style=\"color: rgb(0, 0, 0);\">\r\n      </span><span class=\"pun\" style=\"color: rgb(102, 102, 0);\">&lt;?</span><span class=\"pln\" style=\"color: rgb(0, 0, 0);\">php echo </span><span class=\"str\" style=\"color: rgb(0, 136, 0);\">\"Hello, World!\"</span><span class=\"pun\" style=\"color: rgb(102, 102, 0);\">;?&gt;</span><span class=\"pln\" style=\"color: rgb(0, 0, 0);\">\r\n   </span><span class=\"tag\" style=\"color: rgb(0, 0, 136);\">&lt;/body&gt;</span><span class=\"pln\" style=\"color: rgb(0, 0, 0);\">\r\n\r\n</span><span class=\"tag\" style=\"color: rgb(0, 0, 136);\">&lt;/html&gt;</span></pre><h2 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 23px; line-height: 2rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Applications of PHP</h2><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">As mentioned before, PHP is one of the most widely used language over the web. I\'m going to list few of them here:</p><ul class=\"list\" style=\"color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma; margin-bottom: 0rem !important;\"><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">PHP performs system functions, i.e. from files on a system it can create, open, read, write, and close them.</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">PHP can handle forms, i.e. gather data from files, save data to a file, through email you can send data, return data to the user.</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">You add, delete, modify elements within your database through PHP.</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Access cookies variables and set cookies.</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Using PHP, you can restrict users to access some pages of your website.</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">It can encrypt data.</p></li></ul><h2 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 23px; line-height: 2rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Audience</h2><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">This&nbsp;<span style=\"font-weight: 640;\">PHP tutorial</span>&nbsp;is designed for PHP programmers who are completely unaware of PHP concepts but they have basic understanding on computer programming.</p><h2 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 23px; line-height: 2rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Prerequisites</h2><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Before proceeding with this tutorial you should have at least basic understanding of computer programming, Internet, Database, and MySQL etc is very helpful.</p>', 'PHP - Overview - Sarck Solution', 'PHP Tutorial - The PHP Hypertext Preprocessor (PHP) is a programming language that allows web developers to create dynamic content that interacts with databases.', NULL, 'PHP - Overview - Sarck Solution', 'PHP Tutorial - The PHP Hypertext Preprocessor (PHP) is a programming language that allows web developers to create dynamic content that interacts with databases.', 'https://sarcksolution.com/public/images/logo.jpg', '2020-12-06 06:20:45', '2020-12-19 10:26:45'),
(3, 'laravel', 'Laravel', '1791101302.jpg', '<p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Laravel is an open-source PHP framework, which is robust and easy to understand. It follows a model-view-controller design pattern. Laravel reuses the existing components of different frameworks which helps in creating a web application. The web application thus designed is more structured and pragmatic.</p><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Laravel offers a rich set of functionalities which incorporates the basic features of PHP frameworks like CodeIgniter, Yii and other programming languages like Ruby on Rails. Laravel has a very rich set of features which will boost the speed of web development.</p><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">If you are familiar with Core PHP and Advanced PHP, Laravel will make your task easier. It saves a lot time if you are planning to develop a website from scratch. Moreover, a website built in Laravel is secure and prevents several web attacks.</p><h2 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 23px; line-height: 2rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Advantages of Laravel</h2><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Laravel offers you the following advantages, when you are designing a web application based on it −</p><ul class=\"list\" style=\"color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma; margin-bottom: 0rem !important;\"><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">The web application becomes more scalable, owing to the Laravel framework.</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Considerable time is saved in designing the web application, since Laravel reuses the components from other framework in developing web application.</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">It includes namespaces and interfaces, thus helps to organize and manage resources.</p></li></ul><h3 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 18px; line-height: 1.75rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Composer</h3><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Composer is a tool which includes all the dependencies and libraries. It allows a user to create a project with respect to the mentioned framework (for example, those used in Laravel installation). Third party libraries can be installed easily with help of composer.</p><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">All the dependencies are noted in&nbsp;<span style=\"font-weight: 640;\">composer.json</span>&nbsp;file which is placed in the source folder.</p><h3 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 18px; line-height: 1.75rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Artisan</h3><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Command line interface used in Laravel is called&nbsp;<span style=\"font-weight: 640;\">Artisan</span>. It includes a set of commands which assists in building a web application. These commands are incorporated from Symphony framework, resulting in add-on features in Laravel 5.1 (latest version of Laravel).</p><h2 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 23px; line-height: 2rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Features of Laravel</h2><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Laravel offers the following key features which makes it an ideal choice for designing web applications −</p><h3 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 18px; line-height: 1.75rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Modularity</h3><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Laravel provides 20 built in libraries and modules which helps in enhancement of the application. Every module is integrated with Composer dependency manager which eases updates.</p><h3 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 18px; line-height: 1.75rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Testability</h3><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Laravel includes features and helpers which helps in testing through various test cases. This feature helps in maintaining the code as per the requirements.</p><h3 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 18px; line-height: 1.75rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Routing</h3><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Laravel provides a flexible approach to the user to define routes in the web application. Routing helps to scale the application in a better way and increases its performance.</p><h3 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 18px; line-height: 1.75rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Configuration Management</h3><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">A web application designed in Laravel will be running on different environments, which means that there will be a constant change in its configuration. Laravel provides a consistent approach to handle the configuration in an efficient way.</p><h3 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 18px; line-height: 1.75rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Query Builder and ORM</h3><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Laravel incorporates a query builder which helps in querying databases using various simple chain methods. It provides&nbsp;<span style=\"font-weight: 640;\">ORM</span>&nbsp;(Object Relational Mapper) and&nbsp;<span style=\"font-weight: 640;\">ActiveRecord</span>&nbsp;implementation called Eloquent.</p><h3 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 18px; line-height: 1.75rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Schema Builder</h3><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Schema Builder maintains the database definitions and schema in PHP code. It also maintains a track of changes with respect to database migrations.</p><h3 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 18px; line-height: 1.75rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Template Engine</h3><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Laravel uses the&nbsp;<span style=\"font-weight: 640;\">Blade Template</span>&nbsp;engine, a lightweight template language used to design hierarchical blocks and layouts with predefined blocks that include dynamic content.</p><h3 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 18px; line-height: 1.75rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">E-mail</h3><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Laravel includes a&nbsp;<span style=\"font-weight: 640;\">mail</span>&nbsp;class which helps in sending mail with rich content and attachments from the web application.</p><h3 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 18px; line-height: 1.75rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Authentication</h3><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">User authentication is a common feature in web applications. Laravel eases designing authentication as it includes features such as&nbsp;<span style=\"font-weight: 640;\">register, forgot password</span>&nbsp;and&nbsp;<span style=\"font-weight: 640;\">send password reminders</span>.</p><h3 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 18px; line-height: 1.75rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Redis</h3><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Laravel uses&nbsp;<span style=\"font-weight: 640;\">Redis</span>&nbsp;to connect to an existing session and general-purpose cache. Redis interacts with session directly.</p><h3 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 18px; line-height: 1.75rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Queues</h3><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Laravel includes queue services like emailing large number of users or a specified&nbsp;<span style=\"font-weight: 640;\">Cron</span>&nbsp;job. These queues help in completing tasks in an easier manner without waiting for the previous task to be completed.</p><h3 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 18px; line-height: 1.75rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Event and Command Bus</h3><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Laravel 5.1 includes&nbsp;<span style=\"font-weight: 640;\">Command Bus</span>&nbsp;which helps in executing commands and dispatch events in a simple way. The commands in Laravel act as per the application’s lifecycle.</p>', 'Laravel - Overview - Sarck Solution', 'Laravel - Overview - Laravel is an open-source PHP framework, which is robust and easy to understand. It follows a model-view-controller design pattern.', NULL, 'Laravel - Overview - Sarck Solution', 'Laravel - Overview - Laravel is an open-source PHP framework, which is robust and easy to understand. It follows a model-view-controller design pattern.', 'https://sarcksolution.com/public/images/logo.jpg', '2020-12-06 06:21:30', '2020-12-19 10:30:44'),
(4, 'javascript', 'Javascript', '2044493961.png', '<h2 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 23px; line-height: 2rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">What is JavaScript ?</h2><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">JavaScript is a dynamic computer programming language. It is lightweight and most commonly used as a part of web pages, whose implementations allow client-side script to interact with the user and make dynamic pages. It is an interpreted programming language with object-oriented capabilities.</p><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">JavaScript was first known as&nbsp;<span style=\"font-weight: 640;\">LiveScript,</span>&nbsp;but Netscape changed its name to JavaScript, possibly because of the excitement being generated by Java. JavaScript made its first appearance in Netscape 2.0 in 1995 with the name&nbsp;<span style=\"font-weight: 640;\">LiveScript</span>. The general-purpose core of the language has been embedded in Netscape, Internet Explorer, and other web browsers.</p><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">The&nbsp;<a rel=\"nofollow\" href=\"http://www.ecma-international.org/publications/index.html\" target=\"_blank\" style=\"background-image: url(&quot;/images/link-icon.png&quot;); background-position: right center; background-size: initial; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(49, 49, 49); padding-right: 22px; padding-bottom: 2px;\">ECMA-262 Specification</a>&nbsp;defined a standard version of the core JavaScript language.</p><ul class=\"list\" style=\"color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma; margin-bottom: 0rem !important;\"><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\">JavaScript is a lightweight, interpreted programming language.</li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\">Designed for creating network-centric applications.</li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\">Complementary to and integrated with Java.</li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\">Complementary to and integrated with HTML.</li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\">Open and cross-platform</li></ul><h2 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 23px; line-height: 2rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Client-Side JavaScript</h2><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Client-side JavaScript is the most common form of the language. The script should be included in or referenced by an HTML document for the code to be interpreted by the browser.</p><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">It means that a web page need not be a static HTML, but can include programs that interact with the user, control the browser, and dynamically create HTML content.</p><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">The JavaScript client-side mechanism provides many advantages over traditional CGI server-side scripts. For example, you might use JavaScript to check if the user has entered a valid e-mail address in a form field.</p><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">The JavaScript code is executed when the user submits the form, and only if all the entries are valid, they would be submitted to the Web Server.</p><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">JavaScript can be used to trap user-initiated events such as button clicks, link navigation, and other actions that the user initiates explicitly or implicitly.</p><h2 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 23px; line-height: 2rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Advantages of JavaScript</h2><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">The merits of using JavaScript are −</p><ul class=\"list\" style=\"color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma; margin-bottom: 0rem !important;\"><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\"><span style=\"font-weight: 640;\">Less server interaction</span>&nbsp;− You can validate user input before sending the page off to the server. This saves server traffic, which means less load on your server.</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\"><span style=\"font-weight: 640;\">Immediate feedback to the visitors</span>&nbsp;− They don\'t have to wait for a page reload to see if they have forgotten to enter something.</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\"><span style=\"font-weight: 640;\">Increased interactivity</span>&nbsp;− You can create interfaces that react when the user hovers over them with a mouse or activates them via the keyboard.</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\"><span style=\"font-weight: 640;\">Richer interfaces</span>&nbsp;− You can use JavaScript to include such items as drag-and-drop components and sliders to give a Rich Interface to your site visitors.</p></li></ul><h2 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 23px; line-height: 2rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Limitations of JavaScript</h2><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">We cannot treat JavaScript as a full-fledged programming language. It lacks the following important features −</p><ul class=\"list\" style=\"color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma; margin-bottom: 0rem !important;\"><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">Client-side JavaScript does not allow the reading or writing of files. This has been kept for security reason.</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">JavaScript cannot be used for networking applications because there is no such support available.</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\">JavaScript doesn\'t have any multi-threading or multiprocessor capabilities.</p></li></ul><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Once again, JavaScript is a lightweight, interpreted programming language that allows you to build interactivity into otherwise static HTML pages.</p><h2 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 23px; line-height: 2rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">JavaScript Development Tools</h2><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">One of major strengths of JavaScript is that it does not require expensive development tools. You can start with a simple text editor such as Notepad. Since it is an interpreted language inside the context of a web browser, you don\'t even need to buy a compiler.</p><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">To make our life simpler, various vendors have come up with very nice JavaScript editing tools. Some of them are listed here −</p><ul class=\"list\" style=\"color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma; margin-bottom: 0rem !important;\"><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\"><span style=\"font-weight: 640;\">Microsoft FrontPage</span>&nbsp;− Microsoft has developed a popular HTML editor called FrontPage. FrontPage also provides web developers with a number of JavaScript tools to assist in the creation of interactive websites.</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\"><span style=\"font-weight: 640;\">Macromedia Dreamweaver MX</span>&nbsp;− Macromedia Dreamweaver MX is a very popular HTML and JavaScript editor in the professional web development crowd. It provides several handy prebuilt JavaScript components, integrates well with databases, and conforms to new standards such as XHTML and XML.</p></li><li style=\"background: url(&quot;/images/icon-bullet.png&quot;) 0px 3px no-repeat; padding: 0px 0px 0px 19px; list-style: none; margin-bottom: 5px;\"><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; color: rgb(0, 0, 0);\"><span style=\"font-weight: 640;\">Macromedia HomeSite 5</span>&nbsp;− HomeSite 5 is a well-liked HTML and JavaScript editor from Macromedia that can be used to manage personal websites effectively.</p></li></ul><h2 style=\"margin-top: 1.25rem; margin-bottom: 0.625rem; font-size: 23px; line-height: 2rem; color: rgba(0, 0, 0, 0.87); font-family: Arial, Verdana, Tahoma;\">Where is JavaScript Today ?</h2><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">The ECMAScript Edition 5 standard will be the first update to be released in over four years. JavaScript 2.0 conforms to Edition 5 of the ECMAScript standard, and the difference between the two is extremely minor.</p><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">The specification for JavaScript 2.0 can be found on the following site:&nbsp;<a rel=\"nofollow\" href=\"http://www.ecmascript.org/\" target=\"_blank\" style=\"background-image: url(&quot;/images/link-icon.png&quot;); background-position: right center; background-size: initial; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(49, 49, 49); padding-right: 22px; padding-bottom: 2px;\">http://www.ecmascript.org/</a></p><p style=\"margin: 0.5em 0.2em 0.6em; padding: 0px; text-align: justify; font-family: Arial, Verdana, Tahoma;\">Today, Netscape\'s JavaScript and Microsoft\'s JScript conform to the ECMAScript standard, although both the languages still support the features that are not a part of the standard.</p>', 'JavaScript | Sarck Solution', 'JavaScript is an interpreted programming language that conforms to the ECMAScript specification. JavaScript is high-level, often just-in-time compiled, and multi-paradigm.', NULL, 'JavaScript | Sarck Solution', 'JavaScript is an interpreted programming language that conforms to the ECMAScript specification. JavaScript is high-level, often just-in-time compiled, and multi-paradigm.', 'https://sarcksolution.com/public/images/logo.jpg', '2020-12-06 06:24:01', '2020-12-19 10:16:19'),
(5, 'css-3', 'CSS 3', '1455277328.png', '<p>Cascading Style Sheets is a style sheet language used for describing the presentation of a document written in a markup language such as HTML. CSS is a cornerstone technology of the World Wide Web, alongside HTML and JavaScript. Wikipedia<br></p>', 'CSS 3', 'CSS 3', NULL, 'CSS 3', 'CSS 3', '1455277328.png', '2020-12-06 06:24:38', '2020-12-06 06:24:38'),
(6, 'vue-js', 'Vue.js', '1916801716.png', '<p>Vue.js is an open-source model–view–viewmodel front end JavaScript framework for building user interfaces and single-page applications. It was created by Evan You, and is maintained by him and the rest of the active core team members.<br></p>', 'Vue.js', 'Vue.js', NULL, 'Vue.js', 'Vue.js', '1916801716.png', '2020-12-07 05:38:16', '2020-12-07 05:38:16');
