(4, 'Payment Dispute/Claims', 'Sarck Solution Ltd. is a company having different divisions offering different services. If any client opens a claim/dispute against any of our services or websites, then we can halt/cancel your service in any of the divisions. We can also terminate any service of clients from any of the divisions/websites if payment is due without any further intimation.', NULL, '2020-12-11 22:06:33', '2020-12-11 22:06:33'),
(5, 'Unlimited Revision', 'We provide unlimited only on the draft design. No revision will be provided once the design is confirmed.', NULL, '2020-12-11 22:07:03', '2020-12-11 22:07:03'),
