(7, 'Payment Terms', 'We accept 100% Advance for projects under $500.However project that exceed $500 can be done in partly payment. Please make sure you pay to the corrent ID , We are not responsible for any wrong payment.\r\n\r\nWe use Payment option as paypal, Pakistani Bank,s and Other Options Listed Here. Please kindly check their terms of use before making any payment.', NULL, '2020-12-11 22:08:31', '2020-12-11 22:08:31');
